using namespace std;


class Solution {
public:
    int subarraySum(vector<int>& nums, int k) {
        vector<int> v;
        int sum = 0;
        v.push_back(sum);

        for(int x: nums) {
            sum+=x;
            v.push_back(sum);
        }

        map<int, int> m;
        int count = 0;
        for(int i=0;i<v.size();i++) {
            int t = v[i];
            if(m.count(t-k) > 0) 
                count+=m[t-k];
            m[t]++;
        }
        return count;
    }
};

